import React, { useEffect, useState } from 'react';
import { fetchData } from '../services/api';
import { useFetch } from '../hooks/useFetch';

function Home() {
  const { data, isLoading, error } = useFetch(fetchData);

  return (
    <div>
      <h1>Home</h1>
      {data && (
        <ul>
          {data.map(item => (
            <li key={item.id}>{item.name}</li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Home;
